import React from 'react';

const PropertiesPanel = ({ selectedLayer, onUpdate }) => {
    const handleParameterChange = (param, value) => {
        onUpdate({ ...selectedLayer, [param]: value });
    };

    if (!selectedLayer) {
        return <div>Select a layer to see its properties.</div>;
    }

    return (
        <div>
            <h3>Properties</h3>
            <div>
                <label>Layer Type:</label>
                <span>{selectedLayer.type}</span>
            </div>
            {selectedLayer.type === 'Conv2D' && (
                <>
                    <div>
                        <label>Number of Filters:</label>
                        <input
                            type="number"
                            value={selectedLayer.filters}
                            onChange={(e) => handleParameterChange('filters', e.target.value)}
                        />
                    </div>
                    <div>
                        <label>Filter Size:</label>
                        <input
                            type="text"
                            value={selectedLayer.filterSize}
                            onChange={(e) => handleParameterChange('filterSize', e.target.value)}
                        />
                    </div>
                    <div>
                        <label>Activation Function:</label>
                        <select
                            value={selectedLayer.activation}
                            onChange={(e) => handleParameterChange('activation', e.target.value)}
                        >
                            <option value="relu">ReLU</option>
                            <option value="sigmoid">Sigmoid</option>
                            <option value="tanh">Tanh</option>
                        </select>
                    </div>
                </>
            )}
            {selectedLayer.type === 'Input' && (
                <div>
                    <label>Input Shape:</label>
                    <input
                        type="text"
                        value={selectedLayer.inputShape}
                        onChange={(e) => handleParameterChange('inputShape', e.target.value)}
                    />
                </div>
            )}
            {selectedLayer.type === 'Output' && (
                <>
                    <div>
                        <label>Output Shape:</label>
                        <input
                            type="text"
                            value={selectedLayer.outputShape}
                            onChange={(e) => handleParameterChange('outputShape', e.target.value)}
                        />
                    </div>
                    <div>
                        <label>Activation Function:</label>
                        <select
                            value={selectedLayer.activation}
                            onChange={(e) => handleParameterChange('activation', e.target.value)}
                        >
                            <option value="softmax">Softmax</option>
                            <option value="sigmoid">Sigmoid</option>
                        </select>
                    </div>
                </>
            )}
            {selectedLayer.type === 'Concat' && (
                <div>
                    <label>Layers to Concatenate:</label>
                    <input
                        type="text"
                        value={selectedLayer.concatLayers}
                        onChange={(e) => handleParameterChange('concatLayers', e.target.value)}
                    />
                </div>
            )}
        </div>
    );
};

export default PropertiesPanel;
